import React from 'react';

function Stats() {
    return ( 
        <div className='container'>
            <div className='row'>
            <ul>
                <li>Futures and options</li>
               </ul>
               <ul>
                <li>Commodity Derivatives</li>
               </ul>
               <ul>
                <li>Currency Derivatives</li>
               </ul>
            </div>
        </div>
     );
}

export default Stats;
